		fileid=(file.split("_")[int(IDnumber)])[:-4]
		###Read in all lines and then remove the route card, comment, and charge/multiplicity
		data = f.readlines()
		atmcrd=data[5:]

		#Remove the newlines and generate a list of the atoms
		atmcrd = [x for x in atmcrd if ((x != '\n'))]
		#Iterate over each atom in the coordinate list
		for i in atmcrd:
			#Make a list of all atoms that aren't the atom we currently have set by the iterator i
			othratms = [x for x in atmcrd if ((x != '\n') and (x != i))]

			#Split the coordinate line i in to a list on whitespace
			atm1=i.split()
			#Make the list into a numpy array
			atm1=np.array(atm1)
			#Get the element indentfier
			atmkey=atm1[0]
			#Iterate over each atom in the coordinate list not including i
			for j in othratms:
				#Split the coordinate line j in to a list on whitespace
				atm2=j.split()
				#Make the list into a numpy array
				atm2=np.array(atm2)
				#Calculate the distance between the i and j atoms
				dist=math.sqrt((float(atm1[1])-float(atm2[1]))**2 + (float(atm1[2])-float(atm2[2]))**2 + (float(atm1[3])-float(atm2[3]))**2)
				#If the distance is less than 2 angstroms
				if dist < 2.0:
					#Make a list of all atoms that aren't the atom we currently have set by the iterator j
					thrdatm = [x for x in othratms if ((x != '\n') and (x != j))]
					#Iterate over each atom in the coordinate list not including j
					for l in thrdatm:
						#Check value for if it has already been added to the AA dictionary value list
						chk=0
						#Split the coordinate line l in to a list on whitespace
						atm3=l.split()
						#Make the list into a numpy array
						atm3=np.array(atm3)
						#Calculate the distance between the i and l atoms
						dist2=math.sqrt((float(atm1[1])-float(atm3[1]))**2 + (float(atm1[2])-float(atm3[2]))**2 + (float(atm1[3])-float(atm3[3]))**2)
						#If the distance is less than 3 angstroms
						if dist2 < 3.0:
							###Calculate the angle
							#Make arrays for interim distances
							onetwo=np.array([0.0,0.0,0.0])
							twothree=np.array([0.0,0.0,0.0])
							#Iterate over each cartesian coordinate
							for y in range(1,4):
								#Subtract the coordinates between two of the three atoms.
								onetwo[y-1] = float(atm1[y])-float(atm2[y])
								twothree[y-1] = float(atm3[y])-float(atm2[y])

							#Calculate the cosine of the angle
							cosine_angle = np.dot(onetwo, twothree) / (np.linalg.norm(onetwo) * np.linalg.norm(twothree))
							#Calculate the angle between the three atoms
							angle = np.arccos(cosine_angle)
				
							#For each angle granularity
							for k in rang:
								#If angle is less than current granularity and nothing has been added to the value array for this atom triple yet
								if (np.degrees(angle) <= k) and chk==0:

									#Update the chk for addition to the value array
									chk=1
									#Make the dictionary key first attempt
									dictkey = atm1[0]+"-"+atm2[0]+"-"+atm3[0]+"-"+str(k)
									#Check if the attempted key is in the AA dictionary keys 
